import React, {useEffect} from "react";
import { Link } from "react-router-dom"
import { Button, Input, FormGroup, Label } from "reactstrap"
import axios from "axios";

function Header() {

    function generateRandomNumbers(){
        axios.post("https://api.random.org/json-rpc/2/invoke", {
          jsonrpc: "2.0",
          method: "generateIntegerSequences",
          params: {
            apiKey: "f47e402c-ba3e-4ca9-8842-55e557335be7",
            n: 1,
            length: 4,
            min: -180,
            max: 90,
            replacement: true,
            base: 10
          },
          id: 28572
        }).then(res => res.data.result.random.data).then(data => console.log(data))
    }


    return (
        <header>

            <div className="header-buttons">
                <Link to="saved">Saved Locations</Link>
                <FormGroup className="header-item-width">
                    <Label for="exampleSelect">Select Number of Coordinates</Label>
                    <Input type="select" name="select" id="exampleSelect">
                        <option>1</option>
                        <option>2</option>
                        <option>3</option>
                        <option>4</option>
                        <option>5</option>
                        <option>6</option>
                        <option>7</option>
                        <option>8</option>
                        <option>9</option>
                    </Input>
                </FormGroup>
                <Button onClick={generateRandomNumbers}color="primary">primary</Button>
            </div>



        </header>
    )
};

export default Header;
